const input = '';;
// const input = 'dabAcCaCBAcCcaDA';

console.log(`Part 1: ${getPolymerLength(input)}`);
console.log(`Part 2: ${getPolymerLengthAfterRemoveProblem(input)}`);

function getPolymerLengthAfterRemoveProblem(input) {
  const letters = 'abcdefghijklmnopqrstuvwxyz'.split('');
  let bestLength = input.length;
  for(letter of letters) {
    const newInput = input.replace(new RegExp(letter, 'gi'), '')
    const newLength = getPolymerLength(newInput);
    if (newLength < bestLength) {
      bestLength = newLength;
    }
    console.log(`${letter}`);
  }
  return bestLength;
}

function getPolymerLength(input) {
  let prev = '';
  let result = input;
  while (prev !== result) {
    prev = result
    result = performReaction(prev);
  }
  return result.length;
}

function performReaction(input) {
  let array = input.split('');
  index = array.findIndex((v, i, arr) => canReact(v, arr[i+1]));
  if (index === -1) {
    return input;
  }
  array.splice(index, 2);
  return array.join('');
}

function canReact(a, b) {
  if (a === undefined || b === undefined) {
    return false;
  }
  return (isUpper(a) ^ isUpper(b)) && a.toLowerCase() === b.toLowerCase();
}

function isUpper(char) {
  return char === char.toUpperCase();
}
